import React from "react";

function TaskList({ tasks, onToggle }) {
  return (
    <ul>
      {tasks && tasks.map((task) => (
        <li key={task.id} onClick={() => onToggle(task.id)}>
          {task.text} {task.completed ? "✅" : "❌"}
        </li>
      ))}
    </ul>
  );
}

export default TaskList;
